import React from 'react';
import './App.css';
import Enter from "./Enter";


function App() {

    const [inputs, setInputs] = useState({
        username: '',
        email: ''
    });
    const onChange = e => {
        const { name, value } = e.target;
        setInputs({
            ...inputs,
            [name]: value
        });
    };
  return (
    <>
      <Enter onChange={onChange}></Enter>
    </>
  );
}

export default App;
